CommentBody:
On Escalation Ticket # 00426794 the new comment has been added: Marius Ghiurcau:

@WaitingOnEngineer

@Emil-Ionut Podar I've managed to reproduce something similar (same error), but only if a tried to disable EPP's network extension from Login Items. In that case the extension did not work anymore until I allowed it back. Can you ask the customer if they had to allow our extension before EPP started to block/report transfers properly? Or maybe they have some mass deployment tools that check this and enable it automatically.

I've had some other urgent issues and I postponed investigation of this one, I will try to get back to it soon. In the meantime, can you please also ask the customer if by any chance they, or some software/tool that they are using could have made some changes at Login Items? I know you mentioned also that OS update part, might be that one as well. But I see it happened without any updates also. 

[DevOps CommentId:11444007]

On Escalation Ticket # 00426794 the new comment has been added: Marius Ghiurcau:

@WaitingOnEngineer

@Emil-Ionut Podar while we are waiting for some answers from the customer, I have prepared a test build:

 \192.168.14.5Publicgroups_daily_buildsCoSoSys2024-builds2024_12_31EppMac_v3.0.4.0019

In this build I left some extra logs and also in case the EPP network extension gets disconnected while a connect is in progress, it will try to start again. This could only help if our extension gets disconnected by some app or tool. If by any chance something is happening in the Login Items (maybe the OS tries to disconnect it? or remove it from there?) the changes will not help too much. As mentioned I managed to reproduce something similar only in this scenario, when I disabled the extension form Login Items. 

@Cristian-Alexandru Halmajan @Krzysztof Staszalek please help us with a download link. Thanks!

